🎬 VENDOR VLOG 🎞️ @626nightmarket_bayarea • May 26-28 • Pleasanton, CA • The start of 626 summer camp 🌞

One of my fav + top sales events was slower than I expected—most likely due to multiple events happening the same weekend within close proximity. Was it worth all the expenses? Watch til the end to find out!

Next event: @626nightmarket_oc June 2-4

Shoutout to my vendor friends for taking care of me this weekend 🥹

@caoculator @mew.doodles for driving me to and from the hotel 🚙

@itsjenmade @yooohon @brianchuchutrain @thebaobaeshop for helping me break down in record time ⚡️

@_goyangii for the allergy meds and feeding me 💊

@sherryloustudio for the bandaids and @victoria_llama for always being so uplifting and supportive🩹

@janeli.co for sending your sister to cover my booth during my bathroom break 🫶🏻

The 626 community is truly unmatched and I’m so thankful to be surrounded by kind and caring artist friends! Love you all and hope to see you again in July ❤️

@626nightmarket #626nightmarket #vendorvlog #smallbusiness #popupshop #boothsetup #keychainbusiness #stickershop #smallbusinessowner #smallartist #animalart

Catch me at @626nightmarket_oc this weekend and the next! June 2-4 and June 9-11 from 4-11PM each day! 

This weekend I’m at booth C09 near the entrance! Come find your pets as keychains and stickers. I have  over 1000 dogs, cats, rabbits, birds, reptiles, rodents, farm animals, fish, and insects!

@626nightmarket_oc #626nightmarket #vendor #boothsetup #smallbusiness #etsyfinds #keychainbusiness #stickershop #acryliccharms #popupshop #craftfairdisplay

