Summer camp is coming to an end 🥺 Thank you to my Bay Area vendor friends for making this a fun and memorable weekend! Hope to see you all again soon 😭 @626nightmarket_bayarea @626nightmarket 

These events are exhausting—we endure hot af days, cold nights, constant socialization, physical exertion, and long hours into the late night—but we do it in hopes of making a living off our passions. I couldn’t have asked for a better community of vendors to work alongside ❤️

